import React from "react";
import { makeStyles } from "@material-ui/core/styles";
// import Avatar from "../Images/avataaars.png";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
// import Icons from "./Icons";

const useStyles = makeStyles((theme) => ({
  container: {
    height: 350,
    paddingTop: theme.spacing(20),
    paddingBottom: theme.spacing(500),
    zIndex: 1,
    //     display: "flex",
    //     justifyContent: "center",
    //     alignItems: "center",
    [theme.breakpoints.down("sm")]: {
      height: 750,
    },
  },

  titleHolder: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },

  infoHolder: {
    paddingTop: theme.spacing(10),
  },

  expHolder: {
    width: "50%",
    float: "left",
  },

  expTitle: {
    marginLeft: theme.spacing(15),
  },

  achievementHolder: {
    width: "50%",
    float: "left",
  },

  achievementTitle: {
    marginLeft: theme.spacing(15),
  },
}));

export default function Portfolio() {
  const classes = useStyles();

  return (
    <div className={classes.container} id="Portfolio">
      <Box className={classes.titleHolder}>
        <Typography variant="h3">My Portfolio</Typography>
      </Box>
      <Box className={classes.infoHolder}>
        <Box className={classes.expHolder}>
          <div className={classes.expTitle}>
            <Typography variant="h4">My Portfolio</Typography>
          </div>
        </Box>
        <Box className={classes.achievementHolder}>
          <div className={classes.achievementTitle}>
            <Typography variant="h4">My Portfolio</Typography>
          </div>
        </Box>
      </Box>
    </div>
  );
}

/*
    Experiences can be featured in a table,

    Achievements can be featured in a table,

    Projects can be features in a form of card medias
*/
